import React from 'react';
import {Link} from 'react-router-dom' ;

import './event.module.css';

function Navbar() {

    return(
        <div>
            <section className=''>
               <Link to='/create'>UserSignupForm</Link>
               <Link to = '/login'>UserLoginForm</Link>
               <Link to='/createEvent'>EventCreateForm</Link>
               <Link to='/readEvent'>EventList</Link>
               <Link to='/EventCalendar'>EventCalendar</Link>
            </section>
        </div>
    )
}
export default Navbar;
